import React from 'react';
import { Grid, Typography, makeStyles, Avatar } from "@material-ui/core";
import ClearIcon from "@material-ui/icons/Clear";

const useStyles = makeStyles(theme => ({
    root: {
        border: `1.2px solid ${theme.palette.grey[300]}`,
        padding: theme.spacing(2),
        borderRadius: "3px",
        maxWidth: 200
    },
    headerinsta: {
        color : theme.palette.grey[400],
        heigt: "150px"
    },
    avatar: {
        width: theme.spacing(7),
        height: theme.spacing(7)
    }
}));

export const InstaFollow = () => {
    const classes = useStyles();
    return (
        <Grid container
            alighItems="center"
            direction="column" 
            className={classes.root} 
         >
            <HeaderInsta classes={classes} />
            <ChannelPhoto classes={classes} />
            <ChannelUserName />
            <ChannelName />
            <FollowButton />
        </Grid>
    );
};

const HeaderInsta = ({classes}) => {
    return(
        <Grid container justify="flex-end">
            <Grid item xs={1}>
                <ClearIcon className={classes.headerinsta} />
            </Grid>
        </Grid>
    );
};
const ChannelPhoto = ({classes}) => {
    return (
        <Avatar
            alt="franzkafkaolmak's"
            className={classes.avatar}
            src="https://scontent-arn2-1.cdninstagram.com/v/t51.2885-19/s150x150/52326581_328176374571340_1825972532344258560_n.jpg?_nc_ht=scontent-arn2-1.cdninstagram.com&amp;_nc_ohc=Q6X3WjYOEGIAX99VuNi&amp;oh=9026c96ba90ba19d28f4e6de7328e04b&amp;oe=5F669717" 
            />

    );
};
const ChannelUserName = () => {
    return (
        <Grid container jsutify="center" alignItems="center" spacing={5}>
            <Grid item xs={3}></Grid>
            <Typography variant="body2">
                franzkafkaolmak
            </Typography>
        </Grid>
      
   
    )
}
const ChannelName = () => <Typography variant="h6">ChannelName</Typography>;
const FollowButton = () => <Typography variant="h6">FollowButton</Typography>;
